import Vue from 'vue'
import App from './App.vue'
// 按需引用
import {
  Message
} from 'element-ui';
// 全局组件
import Header from './components/Header'
Vue.component('Header',Header)



Vue.prototype.$message = Message

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
